    [],nt"revision_timestamp": "2015-05-28T23:55:29.476001",nt"name": "treasury-reporting-rates-of-exchange-current-677f3",nt"isopen":
    false,nt"url": null,nt"notes": "This report promulgates exchange rate information
    pursuant to Section 613 of Public Law 87-195 dated September 4, 1961 (22 USC 2363
    (b)) which grants the Secretary of the Treasury sole authority to establish for
    all foreign currencies or credits the exchange rates at which such currencies are
    to be reported by all agencies of the government. The primary purpose is to ensure
    that foreign currency reports prepared by agencies shall be consistent with regularly
    published Treasury foreign currency reports as to amounts stated in foreign currency
    units and U.S. dollar equivalents. This covers all foreign currencies in which the
    U.S. government has an interest, including receipts and disbursements, accrued revenues
    and expenditures, authorizations, obligations, receivables and payables, refunds,
    and similar reverse transaction items.",nt"license_title": "License Not Specified",nt"extras":
